import React from "react";

const SavedMovie = ({ likedMovie }) => {
  return (
    <div className="likedMovie_container">
      <div className="likedMovie_image">
        <img
          src={`https://image.tmdb.org/t/p/w500${likedMovie.poster_path}`}
          alt="movie_poster"
        ></img>
      </div>
      <div className="likedMovie_details">
        <h5>{likedMovie.title}</h5>
      </div>
    </div>
  );
};

export default SavedMovie;
